import React from "react";

class BankAccount {
  constructor(owner, balance) {
    this.owner = owner;
    this.balance = balance;
  }
  show() {
    console.log(`Hello ${owner} `);
  }
}
const newAccount = new BankAccount("Will Alexander", 500);
console.log(newAccount);

const App = () => {
  return <div>Hellow</div>;
};

export default App;
